INSERT INTO `riic_programs` (`id`, `program_name`, `sector`, `province`, `company_agency`, `address`, `oic`, `email`, `contact_number`, `description`) VALUES
(1, 'Science for Change Program (S4CP)', '', 'Cavite, Laguna, Batangas, Rizal, Quezon', 'DOST IV-A', 'Jamboree Road, Brgy. Timugan, Los Ba&ntilde;os, Laguna', '[{&quot;name&quot;: &quot;Engr. Francisco R. Barquilla III&quot;, &quot;designation&quot;: &quot;S4CP Regional Coordinator for CALABARZON&quot;}]', 'frbarquilla @yahoo.com', '(049) 536 4997', '&lt;p&gt;The Science for Change Program (S4CP) aims to accelerate Science, technology, and innovation (STI) in the country through its programs on S&amp;T Human Resource Development and R&amp;D. These programs include the following:&lt;/p&gt;\n&lt;ol&gt;\n&lt;li&gt;Niche Centers in the Regions for R&amp;D (NICER) - The DOST, through the NICER Program will capacitate Higher Education Institutions (HEIs) in the regions to make significant improvement in regional research by integrating its development needs with the existing R&amp;D research capabilities and resources. It will provide institutional grant for R&amp;D capacity building to improve their S&amp;T infrastructure.&lt;/li&gt;\n\n&lt;li&gt; Collaborative R&amp;D to Leverage the Philippine Economy (CRADLE) - Through the CRADLE Program, an industry is expected to identify a problem while its partner Higher Education Institution (HEI) or Research Development Institution (RDI) will undertake the necessary research and development (R&amp;D) to find solutions.&lt;/li&gt;\n\n&lt;li&gt; R&amp;D Leadership Program (RD Lead) - Through this program, the HEIs or RDIs, will engage experts with strong leadership, management and innovative policy-making proficiencies to be in charge of strengthening the research capabilities of\nthe HEIs or RDIs.&lt;/li&gt;\n\n&lt;li&gt; Business Innovation through S&amp;T (BIST) for Industry - BIST is designed to assist Filipino-owned companies to innovate and develop competitiveness and adapt to changing global dynamics.&lt;/li&gt;\n&lt;/ol&gt;\n&lt;p&gt;For more information, you may visit the S4CP website through this link: &lt;a href=&quot;s4cp.dost.gov.ph&quot; target=&quot;_blank&quot;&gt;s4cp.dost.gov.ph &lt;/a&gt;&lt;/p&gt;'),
(2, 'SETUP', 'Food Processing, Furniture, Gifts, Decors &amp; Handicrafts, Marine and Aquatic Resources, Horticulture, Metals and Engineering', 'Cavite, Laguna, Batangas, Rizal, Quezon', 'DOST', 'Regional Office: Jamboree Road, Brgy. Timugan, Los Ba&ntilde;os, Laguna', '[{ &quot;name&quot;: &quot;Ms. Lyn F. Aggangan&quot;, &quot;designation&quot;: &quot;Head, Regional Program Management and Operation Unit DOST CALABARZON&quot; }]', 'rpmo@ro4a.dost.gov.ph', '(049)536-4894', '&lt;p&gt; SETUP is a nationwide strategy aimed at encouraging and assisting MSMEs to adopt technology innovations and to improve their operations. Through technology transfers and commercialization efforts, SETUP enables firms to address their technical problems and boost their productivity and competitiveness. The program assists MSMEs through the provision of technology; testing of products for compliance to international standards; assistance in packaging and labeling of products; creation and management of databases and information systems; and links with national and international organizations to provide raw material source, market, training, financing, and equipment design and fabrication. &lt;/p&gt;\n&lt;p&gt;Learn more about the SETUP program here: &lt;a href=&quot;https://region4a.dost.gov.ph/program-and-projects/small-enterprises-technology-upgrading-program-set-up&quot; target=&quot;_blank&quot;&gt;https://region4a.dost.gov.ph/program-and-projects/small-enterprises-technology-upgrading-program-set-up&lt;/a&gt;&lt;/p&gt;'),
(3, 'Science and Technology Superhighway Program', '', 'Cavite, Laguna, Batangas, Rizal, Quezon', 'DOST IV-A', 'Regional Office: Jamboree Road, Brgy. Timugan, Los Ba&ntilde;os, Laguna', '[{ &quot;name&quot;: &quot;Engr. Francisco R. Barquilla III&quot;, &quot;designation&quot;: &quot;OIC-Office of the Assistant Regional Director&quot; }, { &quot;name&quot;: &quot;Ms. Gilda S. De Jesus&quot;, &quot;designation&quot;: &quot;Science Research Specialist II&quot; }]', 'frbarquilla @yahoo.com, djghie@yahoo.com  / dost4afor@gmail.com', '(049) 536 4997, (046) 419-2085', '&lt;p&gt;The Science and Technology (Scitech) Superhighway Program aims to&lt;/p&gt;\n&lt;ol type=&quot;a&quot;&gt;\n    &lt;li&gt;Facilitate the filing of applications for registration/grant and the protection of inventions, UMs, IDs, and trademarks resulting from DOST-supported researches and innovations&lt;/li&gt;\n    &lt;li&gt;Establish a centralized mechanism for DOST filing and monitoring of IP filings &lt;/li&gt;\n    &lt;li&gt;Institutionalize IPOPHL-DOST partnership in the protection of DOST -supported inventions, UMs, IDs and TMs&lt;/li&gt;\n    &lt;li&gt;Provide capacity building to DOST and its network on IP.&lt;/li&gt;\n&lt;/ol&gt;'),
(4, 'iFWD', '', 'Cavite, Laguna, Batangas, Rizal, Quezon', 'DOST IV-A', 'Regional Office: Jamboree Road, Brgy. Timugan, Los Ba&ntilde;os, Laguna', '[{ &quot;name&quot;: &quot;Ms. Lyn F. Aggangan&quot;, &quot;designation&quot;: &quot;Head, Regional Program Management and Operation Unit DOST CALABARZON&quot;}]', 'rpmo@ro4a.dost.gov.ph', '(049)536-4895', '&lt;p&gt;iFWD PH aims to provide support and opportunities for OFWs and their immediate families to establish technology-based enterprises in the country. &lt;/p&gt;\n&lt;p&gt;Specifically, the Program aims to: &lt;/p&gt;\n&lt;ol&gt;\n    &lt;li&gt;Provide the following package of technology interventions: a. Capability building seminars on entrepreneurship and enterprise development and management.&lt;/li&gt;\n    &lt;li&gt;b. Technical assistance/trainings/consultancies on product development, including packaging and labeling, and professional services; c. Access to DOST facilities for product development and production for market testing; d. Advisory support on service/product marketing; e. Marketing assistance through oneSTore.ph and a network of Small Enterprise Technology Upgrading Program (SETUP) cooperators; and f. Funding assistance for entrepreneurship and technical training, product development and market testing, operational consultancy services, initial laboratory testing, packaging and labeling design and execution for market testing, and equipment acquisition;&lt;/li&gt;\n    &lt;li&gt;Enhance the capability of qualified OFWs in conceptualizing technology-based businesses, and preparing business plans; and&lt;/li&gt;\n    &lt;li&gt;Assist OFWs in establishing and managing technology-based enterprises.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;You may browse their website for more information here: &lt;a href=&quot;https://ifwdph.dost.gov.ph/#what&quot; target=&quot;_blank&quot;&gt; https://ifwdph.dost.gov.ph/#what &lt;/a&gt;&lt;/p&gt;'),
(5, 'One Store', 'Food Processing, Furniture,\nGifts, Decors &amp; Handicrafts, Marine and Aquatic Resources, Horticulture, Metals and Engineering', 'Cavite, Laguna, Batangas, Rizal, Quezon', 'DOST IV-A', 'Regional Office: Jamboree Road, Brgy. Timugan, Los Ba&ntilde;os, Laguna', '[{ &quot;name&quot;: &quot;Ms. Lyn F. Aggangan&quot;, &quot;designation&quot;: &quot;Head, Regional Program Management and Operation Unit DOST CALABARZON&quot; }]', 'dost.oneexpstore@gmail.com', '(049)536-4895', '&lt;p&gt;Onestore.ph aims to provide an e-commerce platform for high-quality Filipino products from the DOST-assisted MSMEs and sell them to a larger audience and in a faster way through the Internet.&lt;/p&gt;\n\n&lt;p&gt;For more information, you may visit their website here: &lt;a href=&quot;https://onestore.ph/&quot; target=&quot;_blank&quot;&gt;https://onestore.ph/&lt;/a&gt;&lt;/p&gt;'),
(6, 'One Lab', 'Testing and Calibration ', 'Cavite, Laguna, Batangas, Rizal, Quezon', 'DOST IV-A', 'Regional Office: Jamboree Road, Brgy. Timugan, Los Ba&ntilde;os, Laguna', '[{ &quot;name&quot;: &quot;Ms. Agnes G. Morales&quot;, &quot;designation&quot;: &quot;Science Research Specialist II&quot;}]', 'rstl_dost4a@yahoo.com', '(049) 536-4390', '&lt;p&gt;A Network of laboratories aimed at ensuring availability and broadening public access to testing and calibration services at a single touchpoint through an IT-based platform. OneLab uniquely facilitates the seamless laboratory transaction from sample receipt to release of test result as facilitated by the OneLab Referral System. With this efficient system, you get the fastest turn-around time and expanded test offerings in the market. Provide relevant and efficient laboratory services for industries, research institutions, other government &amp; Non-government sectors and general public. Offer wider scope of services for different materials and products. Currently, OneLab has 16 DOST Regional Standard and Testing Laboratories(RSTL), 6 DOST Research and Development Institute(RDI) laboratories, 4 government agencies and 19 private local laboratories and 8 international laboratories as members. &lt;/p&gt;\n\n&lt;p&gt;For more information, you may visit their website here: &lt;a href=&quot;http://web.onelab.ph/&quot; target=&quot;_blank&quot;&gt; http://web.onelab.ph/&lt;/a&gt;&lt;/p&gt;'),
(7, 'One Expert', 'Food Processing, Furniture, Gifts, Decors &amp; Handicrafts, Marine and Aquatic Resources, Horticulture, Metals and Engineering', 'Cavite, Laguna, Batangas, Rizal, Quezon', 'DOST IV-A', 'Regional Office: Jamboree Road, Brgy. Timugan, Los Ba&ntilde;os, Laguna', '[{ &quot;name&quot;: &quot;Ms. Lyn F. Aggangan&quot;, &quot;designation&quot;: &quot;Head, Regional Program Management and Operation Unit, DOST CALABARZON&quot;}]', 'rpmo@ro4a.dost.gov.ph', '(049)536-4895', '&lt;p&gt;OneExpert is a platform that is intended to improve access to experts and technologies particularly by people living outside of the major urban centers where most research and technical institutions are located. It aims to do the following: establish a nationwide network of S&amp;T experts; significantly improve access to experts and technologies; encourage involvement of local scientists, researchers, engineers, inventors and other technical people from both the public and private sectors in addressing S&amp;T problems of the country; encourage information and knowledge sharing among local scientists and researchers; enhance the use of ICT in the delivery of government programs, projects and services.&lt;/p&gt;\n&lt;p&gt;You may browse their website for more information here: &lt;a href=&quot;https://oneexpert.gov.ph/&quot; target=&quot;_blank&quot;&gt;https://oneexpert.gov.ph/&lt;/a&gt;&lt;/p&gt;');
INSERT INTO `riic_rnd_facilities` (`id`, `gps`, `facility_name`, `sector`, `province`, `company_agency`, `address`, `oic`, `email`, `contact_number`, `description`) VALUES
(1, '[13.948886, 121.6267499]', 'Center for Hazard and Environment Resource Mapping (CHERM)', 'DRRM', 'Quezon', 'Southern Luzon State University', 'Southern Luzon State University - Lucena Campus, Lucena, Quezon', '[{ &quot;name&quot;: &quot;Dr. DORACIE B. ZOLETA-NANTES&quot;, &quot;designation&quot;: &quot;University President&quot; }, { &quot;name&quot;: &quot;For.RONALD C.GARCIA&quot;, &quot;designation&quot;: &quot;CHERM Manager&quot; }]', 'rcualag2@gmail.com', '(042) 540 4816', '&lt;p&gt;The Center for Hazard and Environmental Resource Mapping (CHERM) was established in 2017 by DOST CALABARZON in partnership with Southern Luzon State University in response to the challenge in using science-based tools and methods in Disaster Risk Reduction and Management (DRRM) and environmental resource management. It was originally intended to be a &lsquo;one-stop-shop&rsquo; center to provide authoritative geospatial data and services&mdash;whether custom printed or downloadable.&lt;/p&gt;\n&lt;p&gt;CHERM also consolidates, harmonizes, and integrate maps and datasets into layers which can be customized for specific purposes of local government units (LGUs), investors, developers, and general public.&lt;/p&gt;\n&lt;p&gt;In 2019, an R&amp;D component of CHERM was proposed, consisting of three subcomponent projects: forest mapping (ASANA), water quality and fish cage monitoring (MATYAG), and coconut mapping (iCOPRA), which have yet to be fully approved by external funding agencies. CHERM has also been introduced to regional councils, including the Regional Development Council (RDC) and Regional Multisectoral Forest Protection Committee (RMFPC). Last year, CHERM continued providing its mapping services for the Regional DRRM Council (RDRRMC) of CALABARZON after the Taal Volcano eruption and for the ongoing COVID-19 pandemic. Different agencies and LGUs may avail of its mapping services for data-driven and evidence-based planning and implementation of their map-related service requirements.&lt;/p&gt;\n&lt;p&gt;CHERM has also launched its official AVP and Virtual Tour video during the recently concluded pre-National Science and Technology Week (NSTW) activities.&lt;/p&gt;\n&lt;p&gt;To view the virtual tour and learn more about CHERM, you may visit this link: &lt;a href=\'https://nstw.dostcalabarzon.ph/tours/cherm\' target=\'_blank\'&gt;https://nstw.dostcalabarzon.ph/tours/cherm&lt;/a&gt;&lt;/p&gt;'),
(2, '[14.083093, 121.3100423]', 'IDEATION, DESIGN AND DEVELOPMENT LABORATORY (IDD)', '', 'Laguna', 'Laguna State Polytechnic University (LSPU)', 'Laguna State Polytechnic University, Bgry. Del Remedio, San Pablo City, Laguna, Region IV-A', '[{ &quot;name&quot;: &quot;Dr. MARIO V. BRIONES&quot;, &quot;designation&quot;: &quot;University President&quot; }, { &quot;name&quot;: &quot;Dr. EDILNERTO Z. ANDAL&quot;, &quot;designation&quot;: &quot;Project Head&quot;}]', 'info@lspu.edu.ph / president_office@lspu.edu.ph, jedilbertoandal@yahoo.com', '(049562) 8130', '&lt;p&gt;Formerly known as San Pablo Product Innovation Center, the Ideation, Design, and Development (IDD) Laboratory was established to provide support to Laguna State Polytechnic University (LSPU) in their ICT equipment through product development, and design and prototyping capabilities. Moreover, the IDD Laboratory aims to assist students in the execution of their designs for innovative products of Lagunenses as food processors, metal fabricators, handicrafts makers, and furniture producers.&lt;/p&gt;\n&lt;p&gt;Recently, IDD-LSPU has approved sub-component project proposals, acquired and installed various technologies such as milling machines, 3D printers, and CNC Plasma cutter; conducted training workshops for designers and manufacturers; benchmarked and visited laboratories; and established links with MSMEs on product prototyping.&lt;/p&gt;\n&lt;p&gt;Learn more about the IDD Laboratory through its Virtual Tour via this link: &lt;a href=\'https://nstw.dostcalabarzon.ph/tours/idd\' target=\'_blank\'&gt;https://nstw.dostcalabarzon.ph/tours/idd&lt;/a&gt;&lt;/p&gt;'),
(3, '[14.4044234, 120.8636034]', 'IDEATION, DESIGN AND DEVELOPMENT LABORATORY (IDD)', '', 'Cavite', 'Cavite State University (CvSU)', 'Brgy. Tejeros Convention, Rosario, Cavite, District 1, Region IV-A', '[{ &quot;name&quot;: &quot;Dr. HERNANDO D. ROBLES&quot;, &quot;designation&quot;: &quot;University President&quot; }, { &quot;name&quot;: &quot;Dr. RODEL B. LUBONG&quot;, &quot;designation&quot;: &quot;In-Charge, IDD&quot;}]', 'office.president@cvsu.edu.ph / hdroble@cvsu.edu.ph, rodel_lubong@yahoo.com', '(046) 415-001', '&lt;p&gt;The IDD-CvSU Laboratory, also known as the &quot;Technovation Center&quot;, was established to create a center that will develop, innovate, package, promote, and commercialize technologies brought by Cavite State University\'s research. Such effort is part of DOST\'s vision towards product development and process improvement of need-driven R&amp;Ds, as well as systems capacity and manufacturing efficiency of MSMEs.&lt;/p&gt;\n&lt;p&gt;Upon its project termination last 2020, the IDD had assisted the IDD-CvSU in its research publication on smoking machine and pelleting machine, as well as its application for utility model registration of the following technologies: automated smoking machine and pelleting machine, prepared automated smoking machine for village-level producers of smoked fish and pelleting machine (for small-scale producers of feed or fuel pellets) for pilot testing and commercialization. The IDD-CvSU Laboratory had also established partnership with Japan International Cooperating Agency (JICA), conducted technical trainings, and appointed lab personnel.&lt;/p&gt;\n&lt;p&gt;Learn more about the IDD Laboratory through its Virtual Tour via this link: &lt;a href=\'https://nstw.dostcalabarzon.ph/tours/idd\' target=\'_blank\'&gt;https://nstw.dostcalabarzon.ph/tours/idd&lt;/a&gt;&lt;/p&gt;'),
(4, '[14.5713826, 121.1691983]', 'REGIONAL DESIGN AND CREATIVITY HUB FOR INNOVATION IN MSMEs AND EDUCATION (RDCHIME)', '', 'Rizal', 'University of Rizal System', 'Marigman St. Barangay, San Roque Antipolo City Rizal, 1870', '[{ &quot;name&quot;: &quot;Dr. NANCY T. PASCUAL&quot;, &quot;designation&quot;: &quot;University President&quot; }, { &quot;name&quot;: &quot;Engr. JANE FRANCES SM MARANION&quot;, &quot;designation&quot;: &quot;Project Head&quot;}]', 'ursmain@gmail.com / researchdir@urs.edu.ph, jsmrnion@gmail.com', '(02) 8401-49-00 (Tanay) / (02) 8653-17-35 (Morong)', '&lt;p&gt;Located at the Provincial Science and Technology Center of Rizal, the RDCHIME (Regional Design and Creativity Hub for Innovation in MSMEs and Education) was established by DOST CALABARZON in partnership with the University of Rizal System to enhance the capability of industries in the Province of Rizal and simultaneously provide educational benefits for the academe.&lt;/p&gt;\n&lt;p&gt;Specifically, it aims to train faculty, students, and industry partners in the development of innovative skills; to support technology-driven product innovation and prototyping in the field of industry processes and automation, instructional materials, digital products and product packaging design and development; to establish prototyping fabrication center for generated ideas and design; and to develop curricular programs leading to digital arts.&lt;/p&gt;\n&lt;p&gt;Since 2019, the RDCHIME Technical Working Group has been attending numerous trainings and workshops, and completing its facility, equipment, and Laboratory Operational Manual to get an accreditation from TESDA in practicing and performing animation. In 2020, RDCHIME launched its official AVP and Virtual Tour video during the recently held pre- National Science and Technology Week (NSTW) activities. It also premiered the RDCHIME Animation Module Making Contest.&lt;/p&gt;\n&lt;p&gt;Learn more about the RDCHIME by visiting this link: &lt;a href=\'https://nstw.dostcalabarzon.ph/tours/chime\' target=\'_blank\'&gt;https://nstw.dostcalabarzon.ph/tours/chime&lt;/a&gt;&lt;/p&gt;'),
(5, '[14.164995277835487, 121.24126052686069]', 'Food Innovation Center', 'Food', 'Laguna', 'University of the Philippines Los Ba&ntilde;os (UPLB)', 'Los Ba&ntilde;os, Laguna', '[{ &quot;name&quot;: &quot;Dr. Lotis E. Mopera&quot;, &quot;designation&quot;: &quot;Center Head&quot; }]', 'ifst.uplb@up.edu.ph', '049-501-8932', '&lt;p&gt;According to the FIC Generic Operational Manual (2016), the Regional Food Innovation Center (FIC) is established in each region of the country to serve as a hub for innovations, R&amp;D, and support services for value-adding of fresh produce and development of processed foods. It is envisioned that through the Center, innovative technologies, relevant support services, technical expertise, necessary infrastructures and facilities will be more accessible for MSMEs in the urban centers and countryside for a more effective technology application, deployment (transfer), and commercialization for sustained economic growth and productivity.&lt;/p&gt;\n&lt;p&gt;The Food Innovation Centers in the CALABARZON region can be located at the Batangas State University in Batangas, and the University of the Philippines Los Ba&ntilde;os in Laguna.&lt;/p&gt;'),
(6, '[13.7837461, 121.0728028]', 'Food Innovation Center', 'Food', 'Batangas', 'Batangas State University', 'Batangas City, Batangas', '[{ &quot;name&quot;: &quot;Marielli Katherine Untalan&quot;, &quot;designation&quot;: &quot;Center Head&quot;}]', 'fic@g.batstate-u.edu.ph', '(043) 980-0385 loc. 1802', '&lt;p&gt;According to the FIC Generic Operational Manual (2016), the Regional Food Innovation Center (FIC) is established in each region of the country to serve as a hub for innovations, R&amp;D, and support services for value-adding of fresh produce and development of processed foods. It is envisioned that through the Center, innovative technologies, relevant support services, technical expertise, necessary infrastructures and facilities will be more accessible for MSMEs in the urban centers and countryside for a more effective technology application, deployment (transfer), and commercialization for sustained economic growth and productivity.&lt;/p&gt;\n&lt;p&gt;The Food Innovation Centers in the CALABARZON region can be located at the Batangas State University in Batangas, and the University of the Philippines Los Ba&ntilde;os in Laguna.&lt;/p&gt;'),
(7, '[14.168200045512481, 121.24329782677898]', 'Southern Tagalog Consortium for Industry and Energy Research and Development (STCIERD)', 'Engineering', 'Laguna', 'DOST IV-A', 'Jamboree Road, Brgy. Timugan, Los Ba&ntilde;os, Laguna', '[{ &quot;name&quot;: &quot;Ms. Emelita P. Bagsit&quot;, &quot;designation&quot;: &quot;STCIERD Chair&quot; }]', 'stcierd.dost@gmail.com', '(049) 536 4997', '&lt;p&gt;The STCIERD is comprised of various member agencies that aim to support the enhancement and orchestration of R&amp;D efforts in relation to regional needs on the industry, energy, utilities and infrastructure sectors. Specifically, it coordinates with the planning and implementation of integrated regional R&amp;D programs and related activities in industry and energy; determine regional R&amp;D priorities and review and update R&amp;D strategies, policies, programs and projects; formulate strategies to generate and develop R&amp;D resources and capabilities in the region and its member agencies; promote the adoption and utilization of R&amp;D output; and foster inter-agency collaboration and the participation of local government and private sector in industry and energy R&amp;D activities.&lt;/p&gt;');
