INSERT INTO `riic_tbi` (`id`, `gps`, `tbi_name`, `sector`, `province`, `company_agency`, `address`, `oic`, `email`, `contact_number`, `description`, `trainings_offered`, `partner_list`) VALUES
(1, '[13.7850032, 121.0719147]', 'Center for Technopreneurship and Innovation', '', 'Batangas', 'Batangas State University', 'Batangas City, Batangas', '[{ &quot;name&quot;: &quot;John Richard Esguerra&quot;, &quot;designation&quot;: &quot;Center Head&quot;}]', 'innovation@g.batstate-u.edu.ph', '(043) 980 0393 loc 2404', '&lt;p&gt;The BatStateU CTI is a university-based technology business incubator that spearheads technopreneurship and is a home of young startup companies in CALABARZON. &lt;/p&gt;\n&lt;p&gt;Learn more about their programs by visiting their website: &lt;a href=\'http://cti.batstate-u.edu.ph/\' target=\'_blank\'&gt;http://cti.batstate-u.edu.ph/&lt;/a&gt;&lt;/p&gt;', '&lt;ol&gt;\n&lt;li&gt;Pitching Skills&lt;/li&gt;\n&lt;li&gt;Proposal Writing&lt;/li&gt;\n&lt;li&gt;Branding and IP Protection&lt;/li&gt;\n&lt;li&gt;Design Thinking&lt;/li&gt;\n&lt;li&gt;Business Modelling&lt;/li&gt;\n&lt;li&gt;Startup 101&lt;/li&gt;\n&lt;/ol&gt;', '&lt;ol&gt;\n    &lt;li&gt;\n        &lt;p&gt;AKADASIA: &lt;/p&gt;\n        &lt;p&gt;The parties intend to promote their relations through mutual friendship and collaboration in the field of technopreneurship and Innovation.&lt;/p&gt;\n        &lt;ul&gt;\n            &lt;li&gt;Conduct an E-Accelerator Program (EAP) &amp; provide certificate of completion for students who finished the program&lt;/li&gt;\n            &lt;li&gt;Facilitate the Train-the-Trainer (TTT) Program &amp; Provides certification of trainers and master trainers for TTT participants&lt;/li&gt;\n            &lt;li&gt;Reserve the right to audit the implementation of the EAP, including teachers, facilitators and academic mentors involved&lt;/li&gt;\n            &lt;li&gt;Provide free access to FREEJOO to BatStateU, to be able to upload its own curriculum on the FREEJOO Platform.&lt;/li&gt;\n        &lt;/ul&gt;\n    &lt;/li&gt;\n\n    &lt;li&gt;\n        &lt;p&gt;BCB Blockchain:&lt;/p&gt;\n        &lt;p&gt;BCB aims to pursue collaboration with BatStateU for reaching out to engage researchers, students and alumni to use BCB blockchain platform and its technologies to create smart city projects and other applied applications.&lt;/p&gt;\n\n        &lt;ul&gt;\n            &lt;li&gt;Provides Blockchain Technology&lt;/li&gt;\n            &lt;li&gt;Grants Hackathons&lt;/li&gt;\n            &lt;li&gt;Grants Competition&lt;/li&gt;\n            &lt;li&gt;Grants Bug Bounty Programs&lt;/li&gt;\n            &lt;li&gt;Provides co-incubation&lt;/li&gt;\n            &lt;li&gt;Smart Cities Research&lt;/li&gt;\n            &lt;li&gt;Ecosystem Building Programs&lt;/li&gt;\n            &lt;li&gt;Provides Marketing Materials for Promotion&lt;/li&gt;\n            &lt;li&gt;Provides industry information on the challenges, needs and requirements&lt;/li&gt;\n            &lt;li&gt;Provide potential industry challenges&lt;/li&gt;\n        &lt;/ul&gt;\n    &lt;/li&gt;\n\n    &lt;li&gt;\n        &lt;p&gt;Technology Park Malaysia:&lt;/p&gt;\n        &lt;p&gt;TPM and BatStateU shall work together in developing the soft-landing / co-incubation program for incubatees / SMEs both sides which include but not limited to:&lt;/p&gt;\n\n        &lt;ol&gt;\n            &lt;li&gt;Provision of physical office space&lt;/li&gt;\n            &lt;li&gt;Support services facilitation&lt;/li&gt;\n            &lt;li&gt;Virtual incubation services&lt;/li&gt;\n        &lt;/ol&gt;\n\n        &lt;ul&gt;\n            &lt;li&gt;Both parties agree that the enrolment of incubatees / SMEs into the Program is subject to screening and selection procedures&lt;/li&gt;\n            &lt;li&gt;Both parties agree that the incubatees / SMEs shall facilitate handholding activities for selected incubatees / SMEs which include but not limited to:&lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;ol&gt;\n            &lt;li&gt;Access to market, funding and technology experts&lt;/li&gt;\n            &lt;li&gt;Access to partnerships and networking&lt;/li&gt;\n            &lt;li&gt;Business advisory related to local business situation and requirements&lt;/li&gt;\n        &lt;/ol&gt;\n    &lt;/li&gt;\n\n    &lt;li&gt;\n        &lt;p&gt;SEARCA:&lt;/p&gt;\n        &lt;p&gt;The project shall be referred to as &ldquo;SICAT&rdquo; | Support for Innovative and Commercially Viable Agricultural Technology.&lt;/p&gt;\n\n        &lt;ol&gt;\n            &lt;li&gt;Provide financial support and facilitate disbursement of funds needed for the implementation&lt;/li&gt;\n            &lt;li&gt;Monitor and evaluate the implementation of the project in accordance with the approved objectives&lt;/li&gt;\n            &lt;li&gt;Provide efficient coordination and administrative support and management system across the project phases/stages&lt;/li&gt;\n        &lt;/ol&gt;\n    &lt;/li&gt;\n\n&lt;/ol&gt;'),
(2, '[14.1648491, 121.2390747]', 'SIBOL UPLB', '', 'Laguna', 'University of the Philippines Los Ba&ntilde;os (UPLB)', 'Los Ba&ntilde;os, Laguna', '', 'ttbdo.tbisibol@gmail.com', '(049) 501 4756', '&lt;p&gt;S.I.B.O.L. Labs stands for STARTUP INNOVATION and BUSINESS OPPORTUNITY LINKAGE Labs. It is the Technology Business Incubation arm of the TTBDO, UPLB. Focusing on Agri-tech, Food Engineering, Biotech and ICT, it aims to nurture the UPLB Startup Ecosystem.&lt;/p&gt;', '&lt;ol&gt;\n    &lt;li&gt;\n        College Runs: Design Thinking and Technopreneurship Workshops\n    &lt;/li&gt;\n    &lt;li&gt;\n        3-Day SIBOL Webinar Series: Innovationeering for Technopreneurship\n        &lt;ul&gt;\n            &lt;li&gt;Day 1: Value Proposition Canvas&lt;/li&gt;\n            &lt;li&gt;Day 2: Business Model Canvas&lt;/li&gt;\n            &lt;li&gt;Day 3: Foundation of Intellectual Property Rights and Prior Art Search&lt;/li&gt;\n        &lt;/ul&gt;\n    &lt;/li&gt;\n    &lt;li&gt;\n        Business Models for SUSTAINABILITY and CIRCULARITY Training\n    &lt;/li&gt;\n&lt;/ol&gt;', '&lt;p&gt;2 international MOA signed March 23, 2021\n&lt;p&gt;\n&lt;p&gt;- Parties Involved: SEARCA, EastWest Seed Company, UPLB APEX, and UPLB SIBOL labs&lt;/p&gt;\n&lt;p&gt;- Responsibilities of parties: for INNOVATION OLYMPICS 2.0 (IDEATION COMPETITION and student startup mentoring nationwide (Luzon, Visayas, Mindanao)&lt;/p&gt;\n&lt;br&gt;\n&lt;p&gt;UPLB: facilitation and coordination of activities in Innovation Olympics 2.0&lt;/p&gt;\n&lt;p&gt;EWS: Funding (P1.5M) and mentoring, co-management, co-promotion&lt;/p&gt;\n&lt;p&gt;SEARCA: Co-funding (P1.5M) and administration, co-promotion&lt;/p&gt;\n&lt;p&gt;UPLB APEX: Student organization partner, co-coordination and co- promotion&lt;/p&gt;\n&lt;br&gt;\n&lt;p&gt;3 International Partners without MOA but currently with active partnership&lt;/p&gt;\n&lt;p&gt;(1) Parties Involved: PnP-LG and UPLB&lt;/p&gt;\n&lt;p&gt;- Terms of responsibilities:&lt;/p&gt;\n&lt;p&gt;PnP-LG: startup acceleration, networking, and corporate introduction&lt;/p&gt;\n&lt;p&gt;UPLB SIBOL: incubation and mentoring&lt;/p&gt;\n&lt;br&gt;\n&lt;p&gt;(2) Parties Involved: Leave A Nest and UPLB&lt;/p&gt;\n&lt;p&gt;- Responsibilities:&lt;/p&gt;\n&lt;p&gt;LAN: Networking, pitching competition, and corporate introduction&lt;/p&gt;\n&lt;p&gt;UPLB SIBOL: incubation and mentoring&lt;/p&gt;\n&lt;br&gt;\n&lt;p&gt;(3) Program: ASEAN-JAIF Incubation Network&lt;/p&gt;\n&lt;p&gt;Partners: ASEAN-JAIF ABInetwork of incubators (without MOA)&lt;/p&gt;\n&lt;p&gt;Role:&lt;/p&gt;\n&lt;p&gt;ASEAN-JAIF: Funding, pitching, training of incubator management staff, study visits, internationalization, corporate introduction, acceleration&lt;/p&gt;\n&lt;p&gt;UPLB SIBOL Labs: one of the Pioneer member of ABINetwork. We serve as participants to the program. 1 Local Partnership (MOA is in process)&lt;/p&gt;\n&lt;p&gt;Co-mentoring Program with Miriam College TBI&lt;/p&gt;'),
